import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);

  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (storedUser) {
      const parsedUser = JSON.parse(storedUser);
      setUser(parsedUser);

      const role = parsedUser.role?.toLowerCase();
      if (role === "tenant") navigate("/tenant");
      else if (role === "landlord") navigate("/landlord");
      else if (role === "admin") navigate("/admin-panel");
      else navigate("/unauthorized");
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    setUser(null);
    navigate("/login");
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <div style={styles.heroIcon}>üè†</div>
        <h1 style={styles.heading}>Smart Property System</h1>
        <p style={styles.subHeading}>Manage leases, payments, and access ‚Äî all in one place.</p>

        {user && (
          <p style={styles.welcome}>üëã Welcome back, <strong>{user.name}</strong></p>
        )}

        <div style={styles.buttonRow}>
          {!user ? (
            <>
              <Link to="/login">
                <button style={styles.primaryButton}>Login</button>
              </Link>
              <Link to="/register">
                <button style={styles.secondaryButton}>Register</button>
              </Link>
            </>
          ) : (
            <button style={styles.logoutButton} onClick={handleLogout}>
              Logout
            </button>
          )}
        </div>
      </div>

      <footer style={styles.footer}>
  <p style={styles.footerText}>¬© {new Date().getFullYear()} Smart Property System</p>
  <div style={styles.footerLinks}>
    <button style={styles.footerLink} onClick={() => alert("Terms page coming soon")}>Terms</button>
    <button style={styles.footerLink} onClick={() => alert("Privacy policy coming soon")}>Privacy</button>
    <button style={styles.footerLink} onClick={() => alert("Contact support coming soon")}>Contact</button>
  </div>
</footer>
    </div>
  );
};

const styles = {
  page: {
    height: "100vh",
    background: "linear-gradient(to bottom right, #eef2f7, #f9fafb)",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    fontFamily: "Segoe UI, sans-serif"
  },
  card: {
    backgroundColor: "#fff",
    padding: "3rem",
    borderRadius: "16px",
    boxShadow: "0 8px 24px rgba(0,0,0,0.08)",
    textAlign: "center",
    maxWidth: "500px",
    width: "90%",
    animation: "fadeIn 0.6s ease"
  },
  heroIcon: {
    fontSize: "3rem",
    marginBottom: "0.5rem"
  },
  heading: {
    fontSize: "2.25rem",
    fontWeight: "700",
    color: "#1e3a8a",
    marginBottom: "0.5rem"
  },
  subHeading: {
    fontSize: "1.1rem",
    color: "#374151",
    marginBottom: "1.5rem"
  },
  welcome: {
    fontSize: "1rem",
    color: "#1f2937",
    marginBottom: "1.5rem"
  },
  buttonRow: {
    display: "flex",
    justifyContent: "center",
    gap: "1rem",
    flexWrap: "wrap"
  },
  primaryButton: {
    padding: "0.75rem 1.5rem",
    backgroundColor: "#1e3a8a",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    fontWeight: "600",
    fontSize: "1rem",
    cursor: "pointer",
    transition: "all 0.2s ease"
  },
  secondaryButton: {
    padding: "0.75rem 1.5rem",
    backgroundColor: "#f3f4f6",
    color: "#1e3a8a",
    border: "1px solid #1e3a8a",
    borderRadius: "8px",
    fontWeight: "600",
    fontSize: "1rem",
    cursor: "pointer",
    transition: "all 0.2s ease"
  },
  logoutButton: {
    padding: "0.75rem 1.5rem",
    backgroundColor: "#dc2626",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    fontWeight: "600",
    fontSize: "1rem",
    cursor: "pointer",
    transition: "all 0.2s ease"
  },
  footer: {
    marginTop: "2rem",
    textAlign: "center",
    fontSize: "0.85rem",
    color: "#6b7280"
  },
  footerText: {
    marginBottom: "0.5rem"
  },
  footerLinks: {
    display: "flex",
    justifyContent: "center",
    gap: "1rem"
  },
  footerLink: {
    color: "#1e3a8a",
    textDecoration: "none",
    fontWeight: "500"
  },
  "@keyframes fadeIn": {
    from: { opacity: 0, transform: "translateY(20px)" },
    to: { opacity: 1, transform: "translateY(0)" }
  }
};

export default Home;
